import { Event } from "./classes";

export default {
    username: "yuanlin",
    calendars: [
        {
            events: [
                new Event(
                    "C程序设计基础 期末考",
                    "重要事項 ",
                    new Date("Wed Jan 08 2020 13:00:00 GMT+0800 (台北標準時間) "),
                    new Date("Wed Jan 08 2020 15:00:00 GMT+0800 (台北標準時間) ")
                )
            ]
        }
    ]
};
